DROP TABLE IF EXISTS `wings_companion_analytics`;
CREATE TABLE `wings_companion_analytics` (
  `create_time` datetime NOT NULL,
  `pid` int(11) NOT NULL,
  `type` tinyint(4) NOT NULL COMMENT '1 用户、2充值、3订阅',
  `value` int(11) DEFAULT NULL,
  PRIMARY KEY (`create_time`,`pid`,`type`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;



